import styled, { keyframes } from "styled-components";
import { Grid, Box } from "@material-ui/core";
import {
  Title,
  UnderTitle,
  CodingCard,
  CodingCardBig,
  CodingCardText,
  CodingCardImage,
  StyledText,
} from "../Builders";

export const Coding = () => {
  return (
    <StyledBox width="90%">
      <Grid container spacing={1}>
        <Grid item xs={12} fullWidth>
          <UnderTitle>Projects</UnderTitle>
        </Grid>

        <Grid item xs={12} fullWidth>
          <TFcard>
            <Grid container spacing={3} direction="row" alignItems="stretch">
              <Grid item xs={4} fullWidth>
                <TFlogo src="/teknikfokuslogo.png"></TFlogo>
              </Grid>
              <Grid item xs={1} fullWidth></Grid>
              <Grid item xs={7} fullWidth>
                <StyledCardTitle>Teknikfokus Website</StyledCardTitle>
                <StyledCardText>
                  Website for Teknikfokus whish is a career fair arranged by
                  students in the E and D-guilds at Lunds Tekniska Högskola.
                </StyledCardText>
              </Grid>
            </Grid>
          </TFcard>
        </Grid>
        <Grid item xs={6} fullWidth>
          <Haponomcard>
            <Grid container spacing={0}>
              <Grid item xs={4} fullWidth>
                <TFlogo src="/haponom.png"></TFlogo>
              </Grid>
              <Grid item xs={6} fullWidth>
                <StyledCardTitle>Metronome App</StyledCardTitle>
                <StyledCardText>
                  Android app using advanced interaction features to control
                  metronome.
                </StyledCardText>
              </Grid>
            </Grid>
          </Haponomcard>
        </Grid>
        <Grid item xs={6} fullWidth>
          <TFcard>
            <Grid container spacing={3}>
              <Grid item xs={6} fullWidth>
                <TFlogo src="/teknikfokuslogo.png"></TFlogo>
              </Grid>
              <Grid item xs={6} fullWidth>
                <StyledCardTitle>Teknikfokus Website</StyledCardTitle>
                <StyledCardText>
                  Website for Teknikfokus whish is a career fair arranged by
                  students in the E and D-guilds at Lunds Tekniska Högskola.
                </StyledCardText>
              </Grid>
            </Grid>
          </TFcard>
        </Grid>
      </Grid>
    </StyledBox>
  );
};

export default Coding;

const StyledBox = styled(Box)`
  margin: auto;
`;

const TFlogo = styled.img`
  max-width: 100%;
`;

const TFcard = styled.div`
  padding: 0.5em;
  box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2);
  transition: 0.3s;
  color: black;
  background-color: #2b343b;

  &:hover {
    box-shadow: 0 8px 16px 0 rgba(0, 0, 0, 0.4);
  }
`;

const Haponomcard = styled.div`
  padding: 0.5em;
  box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2);
  transition: 0.3s;
  color: black;
  background-color: #20a0ff;

  &:hover {
    box-shadow: 0 8px 16px 0 rgba(0, 0, 0, 0.4);
  }
`;

const StyledCardTitle = styled.p`
  margin-top: 0rem;
  color: #fffafa;
  font-size: 4rem;
`;

const StyledCardText = styled.p`
  margin-top: 0rem;
  color: #fffafa;
  font-size: 2rem;
`;
